import React, { Component } from 'react';
import Recipe from "./Recipe"
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.somefunc = this.somefunc.bind(this)
  }
  somefunc(){
    console.log("test")
  }
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <section id = "Header">
              <Recipe/>
          </section>
        </header>
      </div>
    );
  }
}
export default App;
